import "./Page3.css";
import React, { useState } from "react";

function Page3() {
  const [popup, setPop] = useState(false);
  const handleClickOpen = () => {
    setPop(!popup);
  };
  const closePopup = () => {
    setPop(false);
  };

  return (
    <div className="app">
      <div className="bg3">
        <span>
          <button className="buttonPlayer1" onClick={handleClickOpen}>
            PLAYER 1
          </button>
        </span>

        <span>
          <button className="buttonPlayer2">PLAYER 2</button>
        </span>

        <div className="text">PLAYER1</div>
      </div>
    </div>
  );
}

export default Page3;
